import { v4 as uuidv4 } from "uuid"; 
import tc1 from '../Images/tc1.jpg'
import tc2 from '../Images/tc2.jpg'
import tc3 from '../Images/tc3.jpg';
import tc4 from '../Images/tc4.jpg';

const video = false;
const image = true; 

const dataSlider = [
    {
        id: uuidv4(),
        title: "Thunderchicken Photo",
        text: "Completely real and authentic photo of a real live Thunderchicken",
        type: image, 
        vid: tc1
    },
    {
        id: uuidv4(),
        title: "Group Photo",
        text: "Team photo at the Battle for Los Angeles tournament, where we competed with Queen of Hearts. ",
        type: image, 
        img: tc2
    },
    {
        id: uuidv4(),
        title: "Manufacturing",
        text: "Making parts at the Baum Family Makerspace. ",
        type: image, 
        img: tc3
    },
    {
        id: uuidv4(),
        title: "Wiring",
        text: "Wiring work on our robot at the Battle for Los Angeles tournament in between rounds.",
        type: image, 
        img: tc4
    },
]

export default dataSlider;
